import React from "react";

function SongLista({songs, onRemoveSong, onEditSong}){
    return(
        <div>
            {songs.map(song =>{
                <div className="song" key={song.id}>
                <h2>{song.name}</h2>
                <p>{song.released}</p>
                <p>{songs.artist}</p>
                <button onClick={() => onRemoveSong(songs.id)}>Delete</button>
                <button onClick={() => onEditSong(songs.id)}>Edit</button>
                </div>
            }
            )}
        </div>
    )
}

export default SongLista;
